import React from 'react'

const VideoDetail = ({ video }) => {
    if (!video) {
        return <div></div>
    }
    return <div>
                <div className='segmentBorder p-10 r-10'>
                    <div className='greet color-yellow bold'>{video.title}</div>
                    <div className='small white'>{video.description}</div>
                </div>
            </div>;
}

export default VideoDetail;
